    false,nt"url": null,nt"notes": "Obstacles such as ground seepage, inefficient
    water control structures, and backwater in the Sny Ditch are all contributing to
    drainage problems at the Delair Division of Great River NWR. The U.S. Fish and Wildlife
    Service entered into a contract with Ducks Unlimited to investigate these problems,
    make recommendations from a biological standpoint, and develop an engineered approach
    to solving the problems. These recommendations are summarized in this report.",nt"license_title":
